"use client";

interface IContact {
  first_name: string;
  last_name: string;
  job_title: string;
  organization: {
    name: string;
  };
  note: string;
  email: string;
  phone: string;
  social: string;
  photo: string;
}

const contact: IContact = {
  first_name: "Parames",
  last_name: "Pasitprachaja",
  job_title: "Software Engineer",
  organization: {
    name: "Google"
  },
  note: "This is a note",
  email: "erk1994@hotmail.com",
  phone: "+66876543210",
  social: "https://www.linkedin.com/in/parames-pasitprachaja",
  photo:
    "data:image/jpeg;base64,"
};

export default function VcardPage() {
  const fetchAndEncodeImage = async (url: string) => {
    try {
      const response = await fetch(url);
      const blob = await response.blob();

      return new Promise((resolve, reject) => {
        const reader = new FileReader();
        reader.onloadend = () => resolve(reader.result);
        reader.onerror = reject;
        reader.readAsDataURL(blob);
      });
    } catch (error) {
      throw new Error("Failed to fetch or encode the image.");
    }
  };

  const saveContactAsVCard = async () => {
    const base64data = await fetchAndEncodeImage(contact?.photo ?? "");
    const splitBase64data = String(base64data).split(",");

    const vCard = `BEGIN:VCARD
VERSION:3.0
N;CHARSET=utf-8:${contact?.first_name};${contact?.last_name};;;;
FN;CHARSET=utf-8:
TITLE;CHARSET=utf-8:${contact?.job_title}
ORG;CHARSET=utf-8:${contact?.organization.name}
NOTE;CHARSET=utf-8:${contact?.note}
EMAIL;INTERNET;TYPE=Email:${contact.email}
TEL;TYPE=${contact.phone}
URL;TYPE=${contact.social}
PHOTO;ENCODING=b;TYPE=JPEG:${splitBase64data[1]}
END:VCARD`;

    const fileName = `${contact?.first_name}-${contact?.last_name}.vcf`;
    const dataBlob = new Blob([vCard], { type: "text/vcard" });
    const downloadUrl = URL.createObjectURL(dataBlob);
    const link = document.createElement("a");
    link.href = downloadUrl;
    link.download = fileName;
    document.body.appendChild(link);
    link.click();
    // Clean up
    URL.revokeObjectURL(downloadUrl);
    document.body.removeChild(link);
  };

  return (
    <div className="w-full flex flex-col items-center gap-8 px-4 py-10">
      <h1 className="text-4xl">Vcard Page</h1>
      <button
        onClick={saveContactAsVCard}
        className={
          "w-[200px] m-auto p-4 bg-amber-400 rounded-xl text-neutral-200 hover:bg-amber-500"
        }
      >
        Download VCard
      </button>
    </div>
  );
}
